// Function to visualize CANNON.Trimesh using Three.js
function visualizeTrimesh(trimesh) {
    // Convert Trimesh vertices and indices into Three.js BufferGeometry
    const geometry = new THREE.BufferGeometry();

    // Create Float32Array for vertices
    const vertices = new Float32Array(trimesh.vertices);

    // Create Uint32Array for indices
    const indices = new Uint32Array(trimesh.indices);

    // Set the attributes for the geometry
    geometry.setAttribute('position', new THREE.BufferAttribute(vertices, 3));
    geometry.setIndex(new THREE.BufferAttribute(indices, 1));

    // Compute normals for proper shading
    geometry.computeVertexNormals();

    // Create a material for visualization
    const material = new THREE.MeshStandardMaterial({
        color: 0x0077ff,
        wireframe: true, // Set to true if you want to see the edges
        side: THREE.DoubleSide,
    });

    // Create the mesh
    const mesh = new THREE.Mesh(geometry, material);

    return mesh;
}
